    },
}

function DynamicAccessories:CalculateDynamicValue(ID)
    local accessory = accessories[ID]

    local RAP = accessory.Value
    
    local rarity = nil

    for name, range in RAPRanges do
        if RAP >= range.Lower and RAP <= range.Upper then
            rarity = name
            
            local valueRange = RarityRanges[rarity]
            local rarityUpper = valueRange.Upper
            local rarityLower = valueRange.Lower

            RAP = math.ceil(rarityLower + (RAP - range.Lower) * ((rarityUpper - rarityLower) / (range.Upper - range.Lower)))
            break
        end
    end
    
    if rarity == nil then
        RAP = 0
    end

    return RAP, rarity
end

function DynamicAccessories:CalculateDynamicRewards(ID)

    local accessory = accessories[ID]

    local value = accessory.Value
    local rarity = accessory.Rarity

    local reward = accessory.Reward

    if RarityRewards[rarity] then
        local rewardRange = RarityRewards[rarity]
        local minVal = RarityRanges[rarity].Lower
        local maxVal = RarityRanges[rarity].Upper
        if reward.AddPerClick then
            reward.AddPerClick = math.ceil(reward.AddPerClick * math.ceil(rewardRange.LowerAddPerClick + (value - minVal) * ((rewardRange.UpperAddPerClick - rewardRange.LowerAddPerClick) / (maxVal - minVal))))
        end
        if reward.AddStorage then
            reward.AddStorage = math.ceil(reward.AddStorage * math.ceil(rewardRange.LowerAddStorage + (value - minVal) * ((rewardRange.UpperAddStorage - rewardRange.LowerAddStorage) / (maxVal - minVal))))
        end
    end

    return reward
end

function DynamicAccessories:Init()
    for index, data in accessories do
        if data.Rarity ~= nil then
            continue
        end
        data.Value, data.Rarity = DynamicAccessories:CalculateDynamicValue(index)
        data.Reward = DynamicAccessories:CalculateDynamicRewards(index)
    end
end

DynamicAccessories:Init()

